const MultiForm = formType => {
	if (!formType) {
	} else if (formType == "job") {
		let steps = "4";
	}
	return (
		<div className="multi-form">
			<div className="tlwrapper">
				<div className="steps">
					<div className="step ">
						<div className="marker complete-step">1</div>
					</div>
					<div className="step ">
						<div className="marker">2</div>
					</div>

					<div className="step ">
						<div className="marker">3</div>
					</div>
					<div className="step ">
						<div className="marker">4</div>
					</div>
				</div>
			</div>
			<form>
				<div className="slide active-slide" id="slide1">
					<p>How many repples is the bag of bobbish worth?</p>
					<input type="text" placehulder="repples???"></input>
					<button className="btn"></button>
				</div>
				<div className="slide" id="slide2">
					<p>How many repples is the plumbus worth?</p>
					<input type="text" placehulder="repples???"></input>{" "}
				</div>
				<div className="slide" id="slide3">
					<p>How many repples are the crushed red party cups worth?</p>
					<input type="text" placehulder="repples???"></input>{" "}
				</div>
			</form>
			<style jsx>{`
				.multi-form {
					height: 100%;
					width: 100%;
					display: block;
				}
				.slide {
					opacity: 0;
				}
				.active-slide {
					opacity: 1;
				}
				.steps {
					display: flex;
					width: 100%;
					justify-content: space-evenly;
				}
				.step {
					flex: 1 0 auto;
					background: #d0d0d0;
					margin: 15px;
					position: relative;
					display: flex;
					justify-content: space-between;
				}
				.step::after {
					content: "";
					position: relative;
					right: -5px;
					width: 0;
					height: 0;
					border-top: 10px solid transparent;
					border-bottom: 10px solid transparent;

					border-left: 10px solid blue;
				}
			`}</style>
		</div>
	);
};

export default MultiForm;
